  {name: 'Calamardo', image:'https://th.bing.com/th/id/OIP.IXJKy_PHCB643c7qI8A4QgHaG3?pid=ImgDet&rs=1', state:true},
  {name: 'Da Vinci', image:'https://th.bing.com/th/id/OIP.OSCPEfSuDRmWBavSUHfAbgHaI-?pid=ImgDet&rs=1', state:true},
  {name: 'Dr. Simi', image:'https://i.pinimg.com/originals/bc/09/87/bc09874ea20d57a79ab2606be03f7fb3.jpg', state:true},
  {name: 'Mul치n', image:'https://th.bing.com/th/id/R.4925e26c29e6f74bbb0744695878284d?rik=ycKfp%2bNbzeGdpw&pid=ImgRaw&r=0', state:true},
  {name: 'Mam치 Coco', image:'https://th.bing.com/th/id/OIP._2f7SGaUBPtiS6UBmW_6lQHaFA?pid=ImgDet&rs=1', state:true},
  {name: 'Yoshi', image:'https://th.bing.com/th/id/OIP.vmoBRq5QFBmGqjahUdzPyQHaLV?pid=ImgDet&rs=1', state:true},
  {name: 'Michael Jackson', image:'https://th.bing.com/th/id/R.7bbdd9ce07957c7b12fa4732567e5949?rik=kf5TKRO6EdfgYg&riu=http%3a%2f%2fi.huffpost.com%2fgen%2f1351072%2foriginal.jpg&ehk=l3DNQS5TDQKOINix0fcX%2f1P1aRsIBKGG0%2buDKKx%2fq88%3d&risl=&pid=ImgRaw&r=0', state:true},
  {name: 'Patricio', image:'https://th.bing.com/th/id/OIP.MxZg-aB0gHIleIFSC0zawwHaFW?pid=ImgDet&rs=1', state:true},
]

function Character() {
  return (
    characters.map((character => 
    <Container style={{margin:'0px', marginTop:'20px'}}>
        <Card style={{float:"left",  width:'100px', height:'20', margin:'5px', padding:'0px', backgroundColor:'#ff4444', alignItems:'center', textAlign:'center'}}>
     <Card.Img variant="top" width='100px' height='100px' src={character.image} />
      <Card.Body>
        <Card.Title style={{fontSize:'8px', fontc}}>{character.name}</Card.Title>
        </Card.Body>
        </Card>
    </Container>
    ))
  );
}

export default Character;
